import styled from "styled-components";
import Container from "react-bootstrap/Container";

function App() {
  const Body = styled.body`
    margin: 0;
    background-color: purple;
  `;
  return (
    <div className='App'>
      <Body>
        <Container fluid>
          <h1>Hello from a fluid container</h1>
        </Container>
      </Body>
    </div>
  );
}

export default App;
